import '../App.css';
import { Button } from './Button';
import './About.css';

function AboutSection() {
  return (
    <div className='about-container'>

      <h3>Hough Fintech</h3>
      <h3>Founder: Adrian Hough</h3>
      <p>London-based MBA from SDA Bocconi (Milan, Italy) with Banking experience in Finance, Risk and Change at institutions such as Deutsche Bank, RBC Capital and Bank of America.</p>

    </div>
  );
}

export default AboutSection;
